import React from 'react';

export default function List(props) {
    console.log(props.list);
    const lista = props.list;
    if (lista !== undefined) {
        const listItems = lista.map(function(element, index) {
            return (
                <lu className='doc'>
                <li>{index}</li>
                <li style={{ color: 'red', backgroundColor:'grey' }}> Name user: {element.user}</li>
                <li>title: {element.title}</li>
               <li> content:  {element.content}</li>
               </lu>
            );
          },);
        return (
        <div>
            {listItems}
        </div>
        )
    } 
}
